import React from "react";
import ReactDom from "react-dom";
// import "./index.css";

//DESTRUCTURING

function People() {
  return <section />;
}

const Person = props => {
  console.log(props);

  return (
    <div>
      <h1>{props.name}</h1>
      <p>{props.job}</p>
      <hr />
    </div>
  );
};

ReactDom.render(<People />, document.getElementById("root"));
